import styled from "styled-components"
import logo from '../../images/Logo.png'

export const Header = styled.header`
  height:6.2rem;
  max-width:100%;
  background-color:rgba(0, 47, 52, 0.03);

  display:flex;
  align-items:center
`

export const Logo = styled.div`
 height:4.8rem;
 width:4.8rem;
 background-image:url(${logo});

`

